import React from 'react'

const Question = (props) => {

  return (
    <div><h5>Question {props.question.id}</h5>
    <p>{props.question.question}</p>
    <input name="answer" type="radio"/><label>{props.question.optionA}</label>
    <input name="answer" type="radio"/><label>{props.question.optionB}</label>
    <input name="answer" type="radio"/><label>{props.question.optionC}</label>
    <input name="answer" type="radio"/><label>{props.question.optionD}</label>
    </div>
  )
}

export default Question
